class PatientSystem:
    def __init__(self):
        # Stores all patients keyed by patient_id
        # Each patient contains family_history and vital_history
        self.patients = {}

    def new_patient(self, patient_id, vital_readings, timestamp, family_history):
        """
        Registers a new patient with initial vital readings.
        """
        if patient_id in self.patients:
            raise ValueError(f"Patient {patient_id} already exists")

        # Initialize vital history as time-series lists
        vital_history = {}
        for vital, value in vital_readings.items():
            vital_history[vital] = [(timestamp, value)]

        self.patients[patient_id] = {
            "family_history": list(family_history),
            "vital_history": vital_history
        }

    def update_patient(self, patient_id, vital_readings, timestamp):
        """
        Adds new vital readings for an existing patient.
        """
        if patient_id not in self.patients:
            raise ValueError(f"Patient {patient_id} not found")

        patient = self.patients[patient_id]
        vital_history = patient["vital_history"]

        for vital, value in vital_readings.items():
            if vital not in vital_history:
                vital_history[vital] = []
            vital_history[vital].append((timestamp, value))

    def fetch_patient_data(self, patient_id):
        """
        Returns the patient's stored data.
        """
        if patient_id not in self.patients:
            raise ValueError(f"Patient {patient_id} not found")

        patient = self.patients[patient_id]

        return {
            "patient_id": patient_id,
            "family_history": patient["family_history"],
            "vital_history": patient["vital_history"]
        }

